import React from 'react'
import { connect } from 'react-redux'

const mapStateToProps = state => ({
    auth: state.auth
})

const dashboard  = (props) => {
    alert("here we go")
    alert(props.auth.username)
    return(
        <div>
        <h1>DashBoard</h1>
        <h2>{ props.auth.username }</h2>
        </div>
    )
}

export default connect(
    mapStateToProps
)(dashboard);
